const base64Image = "data:image/png;base64,";

const name = "test";
const description = "hoge";

const { NFTStorage, File } = require('nft.storage');
const { base64ToBlob } = require('base64-blob')

const mime = require('mime');
const fs = require('fs');
const path = require('path');
require('dotenv').config();

async function storeNFT(base64Image, name, description) {
    // const image = base64ToFile(base64Image);
    const image = await base64ToBlob(base64Image)
    const nftstorage = new NFTStorage({ token: process.env.NFT_STORAGE_KEY });
    return nftstorage.store({
        image,
        name,
        description,
    });
}



async function main() {
    const result = await storeNFT(base64Image, name, description);
    console.log(result);
}

main()
.catch(err => {
  console.error(err);
  process.exit(1);
});